import { MdClose } from "react-icons/md";
import "./CartItem.scss";

const CartItem = () => {
    return (
        <div className="cart-products">
            <div className="cart-product">
                <div className="img-container">
                    <img src="" alt="" />
                </div>
            </div>
        </div>
    );
};

export default CartItem;
